import React, { useState } from "react";

function MultiStepForm() {
  const [step, setStep] = useState(1);
  const [formData, setFormData] = useState({
    question: "",
    input1: "",
    input2: "",
    input3: "",
    input4: "",
  });

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleNext = () => {
    if (step === 1 && !formData.question) {
      alert("Please answer the question.");
      return;
    }
    if (step === 2 && Object.values(formData).some((value) => !value)) {
      alert("Please fill in all input fields.");
      return;
    }
    setStep(step + 1);
  };

  const handleSubmit = () => {
    console.log(formData);
  };

  return (
    <div>
      <h1>Multi-Step Form</h1>
      {step === 1 && (
        <div>
          <p>Step 1: Answer a question</p>
          <label>
            What is your favorite color?
            <select
              name="question"
              value={formData.question}
              onChange={handleInputChange}
            >
              <option value="">Select a color</option>
              <option value="red">Red</option>
              <option value="blue">Blue</option>
              <option value="green">Green</option>
              <option value="yellow">Yellow</option>
            </select>
          </label>
        </div>
      )}
      {step === 2 && (
        <div>
          <p>Step 2: Enter some data</p>
          <label>
            Input 1:
            <input
              type="text"
              name="input1"
              value={formData.input1}
              onChange={handleInputChange}
            />
          </label>
          <label>
            Input 2:
            <input
              type="text"
              name="input2"
              value={formData.input2}
              onChange={handleInputChange}
            />
          </label>
          <label>
            Input 3:
            <input
              type="text"
              name="input3"
              value={formData.input3}
              onChange={handleInputChange}
            />
          </label>
          <label>
            Input 4:
            <input
              type="text"
              name="input4"
              value={formData.input4}
              onChange={handleInputChange}
            />
          </label>
        </div>
      )}
      {step === 3 && (
        <div>
          <p>Step 3: Review and Submit</p>
          <div>
            <strong>Question:</strong> {formData.question}
          </div>
          <div>
            <strong>Input 1:</strong> {formData.input1}
          </div>
          <div>
            <strong>Input 2:</strong> {formData.input2}
          </div>
          <div>
            <strong>Input 3:</strong> {formData.input3}
          </div>
          <div>
            <strong>Input 4:</strong> {formData.input4}
          </div>
        </div>
      )}
      <div>
        {step < 3 ? (
          <button onClick={handleNext}>Next</button>
        ) : (
          <button onClick={handleSubmit}>Submit</button>
        )}
      </div>
    </div>
  );
}

export default MultiStepForm;
